import React from 'react'

const Header = ({title}) => {
  return (
    <header className='header'>
        <h1>{title}</h1>

        <button className='btn'>Create Wallet</button>
    </header>
  )
}
Header.defaultProps ={
    title: 'PAYZ',
}
export default Header
